import { BrowserRouter, Routes, Route } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import ABCRestaurant from "./pages/ABCRestaurant";
import ClientDetails from "./pages/ClientDetails";
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";
import Layout from "./components/Layout";
function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Sidebar />
      <Layout />  
      <Routes>
        {/* Dashboard */}
        <Route path="/" element={<Dashboard />} />


        {/* Product routes */}
        <Route path="/abc-restaurant" element={<ABCRestaurant/>} />

        {/* Client routes */}
        <Route path="/client/abc-restaurants" element={<ClientDetails />} />
        <Route path="/client/travelgo" element={<ClientDetails />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
